                "description": "Hi,\nI am now retired after working in forestry for the bulk of my working life.  However when forestry became a dirty word and the government began interfering with the way forestry operated, I made a dramatic career change and spent ten years making bagpipe bags which were exported all over the world.\nI am enjoying retirement because it has enabled me to devote a bit more time to my passion of photography and travelling this fine, wide country of ours.\nI am mainly interested in all things old &amp; rural particularly old woolsheds &amp; farm buildings which exude heaps of character and give that feeling that they would love to share the stories hidden between their walls.\nMy other interest is natural history particularly birds &amp; wildlife in and around the Australian bush.\nI use Sony gear with a couple of Tamron &amp; Sigma lenses as well..\nHope you enjoy viewing my photos as much as I enjoy travelling around this magnificent country taking them!!!\nRegards\nDarryl Kirby\n\nPlease be aware that my photos cannot be downloaded or copied without my written permission. My work is protected under international copyright laws and agreements. None of my photographs may be reproduced, stored in retrieval system, or transmitted, in any form or by any means, electronic, mechanical, photocopying, recording or otherwise, without my prior written permission.\nIf you need to do any of the above activities,please contact me by email at kir54@bigpond.com or on mobile 0419 334 367.",
