                "description": "Amateur photographer continuing to learn by trial and error.  Bought a camera to take shots of my children, they told me to learn to take pictures of subjects other than them, soooo.....  The more I shoot the more I realize I have no clue what I am doing half the time.  Not a very disciplined shooter, I have no area that I concentrate on. Sort of shoot by the rule of serendipity.  \n  Update:   I spend most of my days in dimly lit rooms, studios and stages using my ears for work.  Maybe photography is an natural progression or filling a void.  After thousands of pictures I am still not disciplined with my shooting, but now I consider myself to be experienced amateur…my focus beep is off, the rest of the world doesn’t need reassurance when I’m in focus or for that mater that I am even present with a camera …  ( just like a ninja). \n  I have gotten more confident about what looks pleasing and I'm fortunate  that interesting subjects have passed into frame, but at the end of the day I am just another sound guy with a camera and there are lots of us!       \n      &quot;If you smile at me I will understand, that is something everybody everywhere does in the same language&quot; Crosby, Stills &amp; Kantner",
